            x: deltas[j].pageX*1.0/window.innerWidth,
            y: 1.-deltas[j].pageY*1.0/window.innerHeight
         };
    }
}

function touchEndHandler(event) {
    var deltas = event.changedTouches;
    for(var j = 0; j < deltas.length; j++) {
        var touch = window.touches[ "$" + deltas[j].identifier ];
        touch.dx = (deltas[j].pageX - touch.pageX)*1.0/window.innerWidth;
        touch.dy = (touch.pageY-deltas[j].pageY )*1.0/window.innerHeight
        touch.x = deltas[j].pageX*1.0/window.innerWidth
